CREATE TABLE dvorana
( id INTEGER PRIMARY KEY
  , oznDvorana TEXT NOT NULL UNIQUE
  , kapacitet INTEGER NOT NULL DEFAULT 40
) ;

CREATE TABLE zupanija
( id INTEGER PRIMARY KEY
  , sifZupanija INTEGER NOT NULL UNIQUE
  , nazZupanija TEXT NOT NULL
) ;

CREATE TABLE mjesto
( id INTEGER PRIMARY KEY
  , pbr INTEGER NOT NULL UNIQUE
  , nazMjesto TEXT NOT NULL
  , sifZupanija INTEGER NOT NULL
  , FOREIGN KEY (sifZupanija) REFERENCES zupanija(sifZupanija)
) ;

CREATE TABLE stud
( id INTEGER PRIMARY KEY
  , mbrStud INTEGER NOT NULL UNIQUE
  , imeStud TEXT NOT NULL
  , prezStud TEXT NOT NULL
  , pbrRod INTEGER NOT NULL
  , pbrStan INTEGER NOT NULL
  , datRodStud TEXT NOT NULL CHECK (date(datRodStud) IS NOT NULL)
  , jmbgStud TEXT NOT NULL
  , FOREIGN KEY (pbrRod) REFERENCES mjesto(pbr)
  , FOREIGN KEY (pbrStan) REFERENCES mjesto(pbr)
) ;

CREATE TABLE orgJed
( id INTEGER PRIMARY KEY
  , sifOrgJed INTEGER NOT NULL UNIQUE
  , nazOrgJed TEXT NOT NULL
  , sifNadOrgJed INTEGER NOT NULL
  , FOREIGN KEY (sifNadOrgJed) REFERENCES orgJed(sifOrgJed)
) ;

CREATE TABLE pred
( id INTEGER PRIMARY KEY
  , sifPred INTEGER NOT NULL UNIQUE
  , kratPred TEXT NOT NULL
  , nazPred TEXT NOT NULL
  , sifOrgjed INTEGER NOT NULL
  , upisanoStud INTEGER NOT NULL
  , brojSatiTjedno INTEGER NOT NULL
  , FOREIGN KEY (sifOrgJed) REFERENCES orgJed(sifOrgJed)
) ;

CREATE TABLE nastavnik
( id INTEGER PRIMARY KEY
  , sifNastavnik INTEGER NOT NULL UNIQUE
  , imeNastavnik TEXT NOT NULL
  , prezNastavnik TEXT NOT NULL
  , pbrStan INTEGER NOT NULL
  , sifOrgjed INTEGER NOT NULL
  , koef REAL NOT NULL
  , FOREIGN KEY (pbrStan) REFERENCES mjesto(pbr)
  , FOREIGN KEY (sifOrgJed) REFERENCES orgJed(sifOrgJed)
) ;

CREATE TABLE ispit
( id INTEGER PRIMARY KEY
  , mbrStud INTEGER NOT NULL
  , sifPred INTEGER NOT NULL
  , sifNastavnik INTEGER NOT NULL
  , datIspit TEXT NOT NULL CHECK (date(datIspit) IS NOT NULL)
  , ocjena INTEGER NOT NULL DEFAULT 1
  , UNIQUE (mbrStud, sifPred, datIspit)
  , FOREIGN KEY (mbrStud) REFERENCES stud(mbrStud)
  , FOREIGN KEY (sifPred) REFERENCES pred(sifPred)
  , FOREIGN KEY (sifNastavnik) REFERENCES nastavnik(sifNastavnik)
) ;

CREATE TABLE rezervacija
( id INTEGER PRIMARY KEY
  , oznDvorana TEXT NOT NULL
  , oznVrstaDan TEXT NOT NULL
  , sat INTEGER NOT NULL
  , sifPred INTEGER NOT NULL
  , UNIQUE (oznDvorana, oznVrstaDan, sat)
  , FOREIGN KEY (oznDvorana) REFERENCES dvorana(oznDvorana)
  , FOREIGN KEY (sifPred) REFERENCES pred(sifPred)
) ;



















